import React, { Component } from 'react'
import ReactDOM from 'react-dom';
import Loading from '../components/Loading';
import Ready from '../components/Ready';

const App = (props) => {
  return(
    <div>
      {(
        !this.state.isReady
        ?<Loading/>
        :<Ready {...props}/>
      )}
    </div>
  )
}

export default App;
